import React from 'react';
import Navbar from '../components/Navbar';
import HeroImg from '../components/HeroImg';
import Work from "../components/"
import Footer from '../components/Footer';



const Home = () => {
  return (
    <div>
        <Navbar />
        <HeroImg />
        <Work />
        <Footer />
  </div>
  );   
};

export default Home;
